import React from 'react';
import TradExpress from "../images/TradExpress.svg";
import dashb from '../images/dashb.jpeg';
import exchange_rate from '../images/exchange_rate.png'
import wallet_icon from '../images/wallet_icon.jpeg'
import learn from '../images/learn.jpeg'
import blog from '../images/blog'




const Dashboard = () => {
    return (
        <div>
            <div  className='dashtrad_div'>
                 <img  className='dashtradimg'src={TradExpress} alt=""></img>  
             </div>
             
            <div> <img  className='dashb'src={dashb} alt=""></img> Dashboard</div>
            <div> <img  className='dashb'src={wallet_icon} alt=""></img>Wallet</div>
            <div> <img  className='dashb'src={exchange_rate} alt=""></img> Exchange rate</div>
            <div> <img  className='dashb'src={learn} alt=""></img> Learn</div>
            <div> <img  className='dashb'src={blog} alt=""></img>Blog</div>


           
        </div>
    )
}

export default Dashboard
